import React from 'react';
import './App.css';
import {Route, Switch} from 'react-router-dom';
import Homepage from "./pages/homepage/homepage.component"
import HatsPage from "./pages/hatspage/hatspage.component"
function App() {
  return (
    <div>
      <Switch>
          <Homepage></Homepage>
          <HatsPage></HatsPage>
      </Switch>

    </div>
  );
}

export default App;
